    data: |
      SELECT DISTINCT - + col2 + + - col2 * + col0 + + + 11 AS col1, + 79 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q3411.out
    data: |
      -741	79
      -869	79
      -9691	79
